Congratulate Odisha Adarsha Vidyalaya, Notar, Nayagarh on winning first prize in the online idea competition during #RoadSafetyWeek2020. Appreciate the effort of our students to spread traffic awareness so lucidly to protect precious lives.
#NationalRoadSafetyMonth
