Where the mind is without fear and the head is held high;
Where knowledge is free;
Where the world has not been broken up into fragments by narrow domestic walls. 

Humble tributes to #RabindranathTagore. https://t.co/ZpSUeCJ8Xh

Deepest condolences to @CuttackDM who lost his father this morning. In an act of exemplary public service, Sri Bhabani Chayani continues to work without a single day leave during huge personal tragedy. #Odisha salutes his inspirational leadership
@narendramodi
#OdishaFightsCorona

