ମାସ୍କ ପରିଧାନ ସହ ସାମାଜିକ ଦୂରତାକୁ ବଜାୟ ରଖି ଲୋକସେବା ଭବନ ପରିସରରେ ଥିବା କନଭେନ୍ସନ୍ ସେଣ୍ଟରରେ ବିଧାନସଭା ଅଧିବେଶନ ଅନୁଷ୍ଠିତ ହୋଇଛି। ପ୍ରତିଟି ଦଳର ୩୦% ବିଧାୟକଙ୍କୁ ନେଇ ଅନୁଷ୍ଠିତ ଏହି ଅଧିବେଶନରେ ବ୍ୟୟ ମଞ୍ଜୁରୀ ବିଲ୍ ପାରିତ ହୋଇଛି। #OdishaFightsCoronaVirus 

